import React, { useState, useEffect } from 'react';
import { 
  Box, 
  Typography, 
  Card, 
  CardContent, 
  Grid, 
  Button,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Chip,
  TextField
} from '@mui/material';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import { AdapterDateFns } from '@mui/x-date-pickers/AdapterDateFns';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import ptBR from 'date-fns/locale/pt-BR';
import { format } from 'date-fns';

export default function Agendamentos() {
  const [selectedDate, setSelectedDate] = useState(new Date());
  const [userType, setUserType] = useState('clinica'); // Temporariamente definido como 'clinica' para teste
  const [agendamentos, setAgendamentos] = useState([
    // Dados de exemplo - depois vamos integrar com o backend
    {
      id: 1,
      data: '2024-03-12T10:00:00',
      paciente: 'João Silva',
      clinica: 'Clínica das Flores',
      especialidade: 'Odontologia',
      status: 'confirmado'
    },
    {
      id: 2,
      data: '2024-03-12T14:30:00',
      paciente: 'Maria Santos',
      clinica: 'Clínica das Flores',
      especialidade: 'Limpeza',
      status: 'pendente'
    }
  ]);

  useEffect(() => {
    try {
      const userStr = localStorage.getItem('user');
      if (userStr) {
        const user = JSON.parse(userStr);
        setUserType(user.tipo);
      }
    } catch (error) {
      console.error('Erro ao carregar dados do usuário:', error);
    }
  }, []);

  const getStatusColor = (status) => {
    switch (status) {
      case 'confirmado':
        return { color: '#4caf50', background: '#4caf5022' };
      case 'pendente':
        return { color: '#ff9800', background: '#ff980022' };
      case 'cancelado':
        return { color: '#f44336', background: '#f4433622' };
      default:
        return { color: '#757575', background: '#75757522' };
    }
  };

  return (
    <Box sx={{ minHeight: '100vh', background: 'radial-gradient(circle at 50% 30%, #23272f 60%, #181a20 100%)', p: { xs: 2, md: 4 } }}>
      <Box sx={{ maxWidth: 1200, mx: 'auto' }}>
        <Typography variant="h4" fontWeight={800} color="#fff" mb={4}>
          {userType === 'clinica' ? 'Agenda da Clínica' : 'Meus Agendamentos'}
        </Typography>

        <Grid container spacing={4}>
          {/* Calendário */}
          <Grid item xs={12} md={4}>
            <Card sx={{ background: 'rgba(30,34,44,0.96)', backdropFilter: 'blur(8px)', borderRadius: 4, boxShadow: 8 }}>
              <CardContent>
                <LocalizationProvider dateAdapter={AdapterDateFns} adapterLocale={ptBR}>
                  <DatePicker
                    value={selectedDate}
                    onChange={(newDate) => setSelectedDate(newDate)}
                    slotProps={{
                      textField: {
                        fullWidth: true,
                        sx: { 
                          '& .MuiInputBase-root': {
                            color: '#fff',
                            '&:hover fieldset': {
                              borderColor: '#1976d2',
                            },
                          },
                          '& .MuiInputLabel-root': {
                            color: '#fff',
                          },
                          '& .MuiOutlinedInput-notchedOutline': {
                            borderColor: 'rgba(255, 255, 255, 0.23)',
                          },
                        }
                      }
                    }}
                  />
                </LocalizationProvider>
              </CardContent>
            </Card>
          </Grid>

          {/* Lista de Agendamentos */}
          <Grid item xs={12} md={8}>
            <Card sx={{ background: 'rgba(30,34,44,0.96)', backdropFilter: 'blur(8px)', borderRadius: 4, boxShadow: 8 }}>
              <CardContent>
                <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
                  <Typography variant="h6" fontWeight={700} color="#fff">
                    Consultas do Dia
                  </Typography>
                  <Button 
                    variant="contained" 
                    sx={{ 
                      background: 'linear-gradient(90deg, #1976d2 60%, #0d47a1 100%)',
                      borderRadius: 2,
                      fontWeight: 600
                    }}
                  >
                    {userType === 'clinica' ? 'Novo Horário' : 'Agendar Consulta'}
                  </Button>
                </Box>

                <TableContainer component={Paper} sx={{ background: 'transparent', boxShadow: 'none' }}>
                  <Table>
                    <TableHead>
                      <TableRow>
                        <TableCell sx={{ color: '#b0b8c1', borderBottom: '1px solid #333' }}>Horário</TableCell>
                        {userType === 'clinica' ? (
                          <TableCell sx={{ color: '#b0b8c1', borderBottom: '1px solid #333' }}>Paciente</TableCell>
                        ) : (
                          <TableCell sx={{ color: '#b0b8c1', borderBottom: '1px solid #333' }}>Clínica</TableCell>
                        )}
                        <TableCell sx={{ color: '#b0b8c1', borderBottom: '1px solid #333' }}>Especialidade</TableCell>
                        <TableCell sx={{ color: '#b0b8c1', borderBottom: '1px solid #333' }}>Status</TableCell>
                        <TableCell sx={{ color: '#b0b8c1', borderBottom: '1px solid #333' }}>Ações</TableCell>
                      </TableRow>
                    </TableHead>
                    <TableBody>
                      {agendamentos.map((agendamento) => (
                        <TableRow key={agendamento.id}>
                          <TableCell sx={{ color: '#fff', borderBottom: '1px solid #333' }}>
                            {format(new Date(agendamento.data), 'HH:mm')}
                          </TableCell>
                          <TableCell sx={{ color: '#fff', borderBottom: '1px solid #333' }}>
                            {userType === 'clinica' ? agendamento.paciente : agendamento.clinica}
                          </TableCell>
                          <TableCell sx={{ color: '#fff', borderBottom: '1px solid #333' }}>
                            {agendamento.especialidade}
                          </TableCell>
                          <TableCell sx={{ borderBottom: '1px solid #333' }}>
                            <Chip 
                              label={agendamento.status}
                              sx={{
                                ...getStatusColor(agendamento.status),
                                textTransform: 'capitalize',
                                fontWeight: 600
                              }}
                            />
                          </TableCell>
                          <TableCell sx={{ borderBottom: '1px solid #333' }}>
                            <Button 
                              variant="outlined" 
                              size="small"
                              sx={{ 
                                color: '#1976d2', 
                                borderColor: '#1976d2',
                                '&:hover': {
                                  borderColor: '#2196f3',
                                  background: 'rgba(25, 118, 210, 0.08)'
                                }
                              }}
                            >
                              Detalhes
                            </Button>
                          </TableCell>
                        </TableRow>
                      ))}
                    </TableBody>
                  </Table>
                </TableContainer>
              </CardContent>
            </Card>
          </Grid>
        </Grid>
      </Box>
    </Box>
  );
}
